#include <stdio.h>

int main() {
    printf("Введите число: ");
    int num;
    scanf("%d", &num);

    char numStr[50]; // Предполагается, что максимальная длина преобразованной строки - 20 символов
    sprintf(numStr, "%d", num);

    char inputStr[] = "4 Привет,  4 4          мир 4";

    int count = 0;
    int index = 0;
    int numLen = 0;

    // Вычисляем длину строки числа
    for (int i = 0; numStr[i]; i++)
        numLen++;

    for (int i = 0; inputStr[i]; i++) {
        if (inputStr[i] == numStr[index++]) {
            if (index == numLen && (inputStr[i + 1] == ' ' || inputStr[i + 1] == '\0')) {
                count++;
                index = 0;
            }
        } else {
            index = 0;
        }
    }

    printf("Количество: %d\n", count);

    return 0;
}
