void Task2() {
    int N;
    scanf("%d", &N);
    int* arr = (int*) malloc(sizeof(int) * N);
    int* newArr = (int*) malloc(sizeof(int) * N);
    for (int i = 0; i < N; i++)
        scanf("%d", &arr[i]);
    int index = 0;
    for (int i = 0; i < N; i++)
        if (arr[i] % 2 == 1)
            newArr[index++] = arr[i];
    for (int i = N - 1; i > -1; i--)
        if (arr[i] % 2 == 0)
            newArr[index++] = arr[i];
    for (int i = 0; i < N; i++)
        printf("%d ", newArr[i]);
    printf("\n");
}
