void Task3() {
    int N;
    int K;
    scanf("%d %d", &N, &K);
    if (K < N) {
        int* arr = (int*) malloc(sizeof(int) * N);
        for (int i = 0; i < N; i++)
            scanf("%d", &arr[i]);
        for (int i = K; i < N - 1; i++)
            arr[i] = arr[i] + 1;
        arr = (int*) realloc(arr, (N - 1) * sizeof(int));
        for (int i = 0; i < N - 1; i++)
            printf("%7d", arr[i]);
        printf("\n");
    }
}
