#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <ctype.h>

int main()
{
    char str[] = "str33oka 52 strochen1ka 52";
    long number = 0;
    char newStr[100] = "";
    char* cursor = str;
    while (*cursor != '\0')
    {
        while (*cursor != '\0' && !isdigit(*cursor))
        {
            cursor++;
        }
        if ( *(cursor - 1) == ' ') {
            number = strtol(cursor, &cursor, 10);
            char tempStr[20];
            itoa(number, tempStr, 10);
            strcat(newStr, tempStr);
            if (*cursor != '\0')
            {
                strcat(newStr, ", ");
            }
        }
        else {
            cursor++;
        }
    }
    printf("Исходная строка: %s\n", str);
    printf("Строка с числами: %s\n", newStr);
    return 0;
}
