#include <stdio.h>
#include <limits.h>

int main() 
{
    int n;
    printf("Введите размер массива: ");
    scanf("%d", &n);
    int *arr = (int*)malloc(n * sizeof(int));
    printf("Введите элементы массива:\n");
    for (int i = 0; i < n; i++)
	{
        scanf("%d", &arr[i]);
    }
    int min1 = INT_MAX; 
    int min2 = INT_MAX; 
    for (int i = 0; i < n; i++)
    {
        if (arr[i] < min1) 
		{
            min2 = min1;
            min1 = arr[i];
        } 
		else if (arr[i] < min2 && arr[i] != min1) 
		{
            min2 = arr[i];
        }
    }
    printf("Два минимальных числа: %d и %d\n", min1, min2);
    return 0;
}

