# 6. Balanced Parentheses v4 100/100
# }{[()]} NO
# {[()]} YES
# {} Yes
# {}} YES
# } NO
# {}() Yes
input_str = str(input())
inp_list = []
isSymetric = True
for i in range(len(input_str)):
    if len(inp_list) == 0:
        if input_str[i] == '}' or input_str[i] == ')' or input_str[i] == ']':
            isSymetric = False
            break
        else:
            if input_str[i] == '{' or input_str[i] == '(' or input_str[i] == '[':
                inp_list.append(input_str[i])
    else:
        if input_str[i] == '{' or input_str[i] == '(' or input_str[i] == '[':
            inp_list.append(input_str[i])
        else:
            if input_str[i] == '}' and inp_list[-1] == '{':
                inp_list.pop()
            if input_str[i] == ')' and inp_list[-1] == '(':
                inp_list.pop()
            if input_str[i] == ']' and inp_list[-1] == '[':
                inp_list.pop()

if isSymetric and len(inp_list) == 0:
    print('YES')
else:
    print('NO')

#include <cstdint>
#include <iostream>
#include <string>
#include <unordered_map>

using namespace std;

int main() {
    unordered_map<string, uint64_t> genome_pair_count;
    string genome1, genome2;
    cin >> genome1 >> genome2;

    for (int i = 1; i < genome1.size(); ++i) {
        string genome_pair = genome1.substr(i - 1, 2);
        genome_pair_count[genome_pair]++;
    }
     
    uint64_t result = 0;
    for (int i = 1; i < genome2.size(); ++i) {
        string genome_pair = genome2.substr(i - 1, 2);
        result += genome_pair_count[genome_pair];
    }

    cout << result;
}

