import Pagination from '../components/UI/Pagination/Pagination.js';
import Button from '../components/UI/Button/Button.js';
import Input from '../components/UI/Input/Input'
import ModalWindow from '../components/ModalWindow/ModalWindow.js';
import Login from '../components/Login/Login.js';
import Loader from '../components/Loader/Loader.js';
import Registration from '../components/Registration/Registration.js';
 
 
export const Home = () => {
    const [lots, setLots] = useState([])
    const [totalPages, setTotalPages] = useState();
    const [pagesToDisplay, setPagesToDisplay] = useState();
    const [page, setPage] = useState(1)
    const [limit, setLimit] = useState(12);
    const [modalVisible, setModalVisible] = useState(false);
    const [modalVisibleReg, setModalVisibleReg] = useState(false);
    const [selectedSort, setSelectedSort] = useState('');
 
    const [searchQuery, setSearchQuery] = useState('');
 
    const sortedLots = useMemo(() => {
        if (searchQuery) {
            return lots.filter(lot => lot.title.toLowerCase().includes(searchQuery.toLowerCase()));
        }
        return lots;
    }, [searchQuery, lots]);
 
    const changePage = (_page) => {
        setPage(_page)
    }
 
    const [fetchLots, isLoading, lotsError] = useFetching(async () => {
        const response = await PostService.getAll(limit, page);
        const data = await response.json();
 
        setTotalPages(data.length);
        setLots(data);
        setPagesToDisplay(getPageCount(data.length, limit));
    })
 
    useEffect(() => {
        fetchLots()
    }, [page, limit])
    if (isLoading) {
        return <Loader />
    } 
        return (
<div>
<h1>HOME</h1>
 
                <div>
<Input value={searchQuery} onChange={e => setSearchQuery(e.target.value)} placeholder="Search" />
</div>
 
                <LotContainer lots={sortedLots} />
