  const handleConfirmPasswordChange = (e) => {
    setFormData((prevData) => ({...prevData, confirmPassword: e.target.value}));
    if (formData.password !== e.target.value) {
      setPasswordMatchError(true);
    } else {
      setPasswordMatchError(false);
    }
